        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(inputName),
      })
}

    return(
        <div className="homePageDiv bg-dark text-light p-4">
            <center>
                <input className="homePageInput" placeholder="enter your name"></input><br></br>
                <button id="homePageSubmitButton" onClick={handleSubmit}>Submit</button>
